!function(){const e={lat:-12.073296,lng:-77.016578};google.maps.event.addDomListener(window,"load",()=>{const t=new google.maps.Map(document.getElementById("map"),{center:e,zoom:15});new google.maps.Marker({map:t,position:e,title:"Nombre del restaurant",visible:!0});(class{static get(e){if(!navigator.geolocation)return alert("No pudimos encontraar tu localizacion"),{lat:0,lng:0};navigator.geolocation.getCurrentPosition(t=>{e({lat:t.coords.latitude,lng:t.coords.longitude})})}}).get(t=>{let a=new google.maps.LatLng(t.lat,t,lng),o=new google.maps.LatLng(e.lat,e,lng);(new google.maps.DistanceMatrixService).getDistanceMatrix({origins:[a],destination:[o],travelMode:google.maps.travelMode.DRIVING},(e,t)=>{if(google.maps,DistanceMatrixStatus.OK){const t=e.rows[0].elements[0].duration.text;document.querySelector("#message").innerHTML=`Estas a ${t} de una comida inolvidable en<span class="acme-script medium">Nombre del restaurante</span>`}})})})}();